import ReactDOM from "react-dom";
import '../src/index.css';
import data from "./data";
console.log(data);

ReactDOM.render(
  <>

  <div className="cards">
  <h1 >List of Netflix Series</h1>

  </div>
  <div className="Card1">

    <img src={data[1].imgsrc} alt="Image of 1899 series"/>
  </div>
  </>,document.getElementById('root')
)
